import './App.css';
import axios from 'axios';
import { useEffect, useState } from 'react';

function App() {
  const [siriData] = useState(null);






  useEffect(() => {
    axios.get('https://localhost/publicTransportation.php')
      .then((res) => {
        // Assuming res.data.Siri contains an object, extract the relevant part
        setSiriData(res.data.Siri || { message: 'No data available' }); // Adjust based on the actual structure of res.data
      })
      .catch((err) => {
        console.error('Error fetching data:', err);
      });
  }, []);

  function ShowData({ Siri }) {
    if (!Siri) {
      return <h2>Loading...</h2>;
    }

    // Render specific properties of the Siri object
    return (
      <div>
        <h2>Service Delivery:</h2>
        <pre>{JSON.stringify(Siri.ServiceDelivery, null, 2)}</pre>
      </div>
    );
  }

  return (
    <div className="App">
      <ShowData Siri={siriData} />
    </div>
  );
}

export default App;
